import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Electronics category
    await page.waitForSelector('a:has-text("Electronics"):visible', { timeout: 5000 });
    await page.click('a:has-text("Electronics"):visible');

    // Wait for sort controls to appear
    await page.waitForSelector('#sortSelect', { timeout: 5000 });

    // Select price low to high sort option
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for products to update after sorting
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take screenshot after applying sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_sort.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_sort.png'));

    // Extract product prices to verify sorting
    const prices = await page.$$eval('.product-price', elements => {
      return elements.slice(0, 5).map(el => {
        const priceText = el.textContent;
        const match = priceText.match(/\$(\d+\.\d{2})/);
        return match ? parseFloat(match[1]) : null;
      }).filter(price => price !== null);
    });

    return {
      success: true,
      action: "Applied price sort filter (low to high) and extracted first 5 product prices",
      extractedData: { prices },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
